const useStyles = makeStyles((theme) => ({
  logo: {
    "flex-grow": 0
  }
}));

export const Navbar = () => {
  const classes = useStyles();

  return ( 
    <AppBar position="static">
      <Toolbar>
        <Button className={classes.logo} variant="outlined">
          T
